import { Link } from 'react-router-dom';

function PaginaInicial() {
  return (
    <div className="text-center p-4">
      <h1 className="text-4xl font-bold">Bem-vinda ao Nosso Espaço Especial</h1>
      <p className="mt-4 text-lg">Uma viagem pelos nossos momentos e memórias juntos.</p>
      <img src="/caminho/para/imagem.jpg" alt="Imagem de Capa" className="my-4 w-full rounded-lg shadow-lg" />
      <Link to="/quiz">
        <button className="mt-4 px-6 py-2 bg-red-500 text-white rounded-full hover:bg-red-600">Começar</button>
      </Link>
    </div>
  );
}

export default PaginaInicial;
